    public int lengthOfLongestSubstring(String s) {
        int length = 0;
        int n = s.length();
        Map<Character, Integer> dict = new HashMap<>();

        for (int i = 0, j = 0; i < n; i++) {
            char c = s.charAt(i);

            if (dict.containsKey(c)) {
                j = Math.max(dict.get(c), j);
            }

            length = Math.max(length, i - j + 1);
            dict.put(c, i + 1);
        }


        return length;

    }
